    rolling = [None] * len(numbers)
    for index, number in enumerate(numbers):
        if index == 0:
            rolling[0] = number
        elif index == len(numbers) - 1:
            rolling[index] = number
        else:
            rolling[index] = max(rolling[index - 1], number)
    return rolling

